    <script type="application/json" id="ac64da54-1cf6-404c-8a7c-c60e7f9c67f1">
      {"d416eef5-825f-44e4-9abc-92ed88f597da":{"version":"3.4.1","title":"Bokeh Application","roots":[{"type":"object","name":"Tabs","id":"p1496","attributes":{"sizing_mode":"stretch_both","tabs":[{"type":"object","name":"TabPanel","id":"p1487","attributes":{"title":"Summary","child":{"type":"object","name":"Div","id":"p1486","attributes":{"styles":{"type":"map","entries":[["width","100%"],["height","100%"],["max-width","1920px"],["max-height","1080px"],["padding","12px"],["border","1px solid lightgray"],["box-shadow","inset 1px 0 8px 0 lightgray"],["overflow","auto"]]},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n\n        &lt;h2&gt; Duration: 13m 13s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 192 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 428.85 s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://127.0.0.1:44949 &lt;/li&gt;\n          &lt;li&gt; Workers: 48 &lt;/li&gt;\n          &lt;li&gt; Threads: 48 &lt;/li&gt;\n          &lt;li&gt; Memory: 187.47 GiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2024.6.0 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2024.6.0 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\n#!/usr/bin/env python\nfrom __future__ import print_function, division\nimport numpy as np\nimport MDAnalysis as mda\nfrom MDAnalysis import Universe, Writer\nfrom MDAnalysis.analysis.align import rotation_matrix\nfrom MDAnalysis.lib.qcprot import CalcRMSDRotationalMatrix\nimport dask\nfrom dask.distributed import Client, performance_report\nfrom dask.delayed import delayed\nfrom dask import multiprocessing\nfrom dask.multiprocessing import get\nimport time\nimport multiprocessing\nfrom shutil import copyfile\nimport pickle\nimport sys\nimport warnings\nfrom Bio import BiopythonDeprecationWarning\nimport os\nimport argparse\n\nwarnings.simplefilter('ignore', BiopythonDeprecationWarning)\nwarnings.filterwarnings('ignore', category=DeprecationWarning, module='MDAnalysis.coordinates.DCD')\n\ndef pickle_size(obj):\n    return sys.getsizeof(pickle.dumps(obj))\n\ndef rmsd(mobile, xref0):\n    xmobile0 = mobile.positions - mobile.center_of_mass()\n    return CalcRMSDRotationalMatrix(xref0.T.astype(np.float64), xmobile0.T.astype(np.float64), mobile.n_atoms, None, None)\n\ndef block_rmsd(ag, ref0, start=None, stop=None, step=None):\n    u = ag.universe\n    xref0 = ref0.positions - ref0.center_of_mass()\n\n    clone = mda.Universe(u._topology, u.trajectory.filename, **u.kwargs)\n    g = clone.atoms[ag.indices]\n    assert u != clone\n\n    bsize = stop - start\n    results = np.zeros([bsize, 2])\n    t_comp = np.zeros(bsize)\n\n    start1 = time.time()\n    for iframe, ts in enumerate(clone.trajectory[start:stop:step]):\n        start2 = time.time()\n        results[iframe, :] = ts.time, rmsd(g, xref0)\n        t_comp[iframe] = time.time() - start2\n\n    t_all_frame = time.time() - start1\n    t_comp_final = np.mean(t_comp)\n\n    return results, t_comp_final, t_all_frame\ndef com_parallel_dask(ag, n_blocks, client):\n    ref0 = ag.universe.select_atoms(\"protein\")\n    bsize = int(np.ceil(ag.universe.trajectory.n_frames / float(n_blocks)))\n\n    blocks = []\n\n    for iblock in range(n_blocks):\n        start, stop, step = iblock * bsize, (iblock + 1) * bsize, 1\n        block_input = (ag, ref0, start, stop, step)\n        out = delayed(block_rmsd)(block_input[0], block_input[1], start=block_input[2], stop=block_input[3], step=block_input[4])\n        blocks.append(out)\n\n    block_input_size = pickle_size(blocks)\n    output = client.compute(blocks, sync=True)\n\n    results = np.vstack([out[0] for out in output])\n    t_comp_avg = np.mean([out[1] for out in output])\n    t_comp_max = np.max([out[1] for out in output])\n    t_all_frame_avg = np.mean([out[2] for out in output])\n    t_all_frame_max = np.max([out[2] for out in output])\n    pickle_size_result = pickle_size(results)\n\n    return results, t_comp_avg, t_comp_max, t_all_frame_avg, t_all_frame_max, pickle_size_result, block_input_size\n\nif __name__ == \"__main__\":\n    parser = argparse.ArgumentParser(description='Run MDAnalysis benchmarks with Dask.')\n    parser.add_argument('--traj_size', type=int, default=300, help='Total size of the trajectory.')\n    parser.add_argument('--block_size', type=int, default=multiprocessing.cpu_count(), help='Size of each block.')\n    parser.add_argument('--iterations', type=int, default=1, help='Number of iterations.')\n    parser.add_argument('--num_traj_sizes', type=int, default=3, help='Number of trajectory sizes.')\n\n    args = parser.parse_args()\n\n    traj_size = args.traj_size\n    block_size = args.block_size\n    iterations = args.iterations\n    num_traj_sizes = args.num_traj_sizes\n\n    traj_sizes = [(i + 1) * traj_size // num_traj_sizes for i in range(num_traj_sizes)]\n\n    PSF, DCD1 = [\"adk4AKE.psf\", \"1ake_007-nowater-core-dt240ps.dcd\"]\n\n    num_cores = multiprocessing.cpu_count()\n    client = Client(n_workers=num_cores)\n    dask.config.set(scheduler='distributed')\n\n    with open('data.txt', mode='w') as file:\n        with performance_report(filename=\"report.html\"):\n            for k in traj_sizes:\n                # Creating the universe for doing benchmark\n                u1 = mda.Universe(PSF, DCD1)\n                longDCD = 'newtraj.dcd'\n\n                # Creating big trajectory sizes from initial trajectory (DCD file)\n                with mda.Writer(longDCD, u1.atoms.n_atoms) as W:\n                    for i in range(k):\n                        for ts in u1.trajectory:\n                            W.write(u1)\n                u = mda.Universe(PSF, longDCD)\n\n                # Doing benchmarks\n                ii = 2\n                for j in range(iterations):  # number of iterations\n                    longDCD1 = 'newtraj{}.dcd'.format(ii)\n                    copyfile(longDCD, longDCD1)\n                    u = mda.Universe(PSF, longDCD1)\n                    print(u)\n                    print(\"frames in trajectory {} for traj_size {}\".format(u.trajectory.n_frames, k))\n                    print(len(u.trajectory))\n                    mobile = u.select_atoms(\"(resid 1:29 or resid 60:121 or resid 160:214) and name CA\")\n\n                    start = time.time()\n                    results, t_comp_avg, t_comp_max, t_all_frame_avg, t_all_frame_max, pickle_size_result, block_input_size = com_parallel_dask(mobile, block_size, client)\n                    tot_time = time.time() - start\n\n                    file.write(\"XTC{} {} {} {} {} {} {} {} {} {}\\n\".format(k, block_size, j, t_comp_avg, t_comp_max, t_all_frame_avg, t_all_frame_max, tot_time, pickle_size_result, block_input_size))\n                    file.flush()\n                    os.remove('newtraj{}.dcd'.format(ii))\n                    ii = ii + 1\n    client.close()\n\n        &lt;/pre&gt;\n        "}}}},{"type":"object","name":"TabPanel","id":"p1491","attributes":{"title":"Task Stream","child":{"type":"object","name":"Figure","id":"p1135","attributes":{"name":"task_stream","sizing_mode":"stretch_both","x_range":{"type":"object","name":"DataRange1d","id":"p1133","attributes":{"range_padding":0}},"y_range":{"type":"object","name":"DataRange1d","id":"p1134","attributes":{"range_padding":0}},"x_scale":{"type":"object","name":"LinearScale","id":"p1145"},"y_scale":{"type":"object","name":"LinearScale","id":"p1146"},"title":{"type":"object","name":"Title","id":"p1138","attributes":{"text":"Task Stream"}},"renderers":[{"type":"object","name":"GlyphRenderer","id":"p1175","attributes":{"data_source":{"type":"object","name":"ColumnDataSource","id":"p1130","attributes":{"selected":{"type":"
